import React, { useState, useEffect } from 'react';
import api from '../utils/axios.config';

const CustomerDashboard = () => {
  const [products, setProducts] = useState([]);
  const [filteredProducts, setFilteredProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [filters, setFilters] = useState({
    gender: 'all',
    search: '',
    sortBy: 'none'
  });

  // Fetch products
  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await api.get('/products');
        setProducts(response.data);
        setFilteredProducts(response.data);
        setLoading(false);
      } catch (err) {
        setError('Error fetching products');
        setLoading(false);
      }
    };

    fetchProducts();
  }, []);

  // Apply filters and sorting
  useEffect(() => {
    let result = [...products];

    // Apply gender filter
    if (filters.gender !== 'all') {
      result = result.filter(product => product.category === filters.gender);
    }

    // Apply search filter
    if (filters.search) {
      result = result.filter(product =>
        product.name.toLowerCase().includes(filters.search.toLowerCase()) ||
        product.material.toLowerCase().includes(filters.search.toLowerCase())
      );
    }

    // Apply sorting
    if (filters.sortBy === 'price-asc') {
      result.sort((a, b) => a.unit_price - b.unit_price);
    } else if (filters.sortBy === 'price-desc') {
      result.sort((a, b) => b.unit_price - a.unit_price);
    }

    setFilteredProducts(result);
  }, [filters, products]);

  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilters(prev => ({
      ...prev,
      [name]: value
    }));
  };

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div className="customer-dashboard">
      <h1>Products</h1>

      {/* Filters Section */}
      <div className="filters-section">
        {/* Search Bar */}
        <div className="search-bar">
          <input
            type="text"
            name="search"
            placeholder="Search products..."
            value={filters.search}
            onChange={handleFilterChange}
            className="search-input"
          />
        </div>

        {/* Gender Filter */}
        <select
          name="gender"
          value={filters.gender}
          onChange={handleFilterChange}
          className="filter-select"
        >
          <option value="all">All Categories</option>
          <option value="male">Male</option>
          <option value="female">Female</option>
        </select>

        {/* Sort Filter */}
        <select
          name="sortBy"
          value={filters.sortBy}
          onChange={handleFilterChange}
          className="filter-select"
        >
          <option value="none">Sort by</option>
          <option value="price-asc">Price: Low to High</option>
          <option value="price-desc">Price: High to Low</option>
        </select>
      </div>

      {/* Products Grid */}
      <div className="products-grid">
        {filteredProducts.map(product => (
          <div key={product.id} className="product-card">
            <h3>{product.name}</h3>
            <div className="product-details">
              <p>Category: {product.category}</p>
              <p>Material: {product.material}</p>
              <p>Available: {product.aval_quantity}</p>
              <p className="price">â‚¹{product.unit_price}</p>
            </div>
          </div>
        ))}
      </div>

      {filteredProducts.length === 0 && (
        <div className="no-products">
          No products found matching your criteria
        </div>
      )}
    </div>
  );
};

export default CustomerDashboard;
